import React from 'react';

const vehicles = [
    { type: 'Bike', price: '3₽/мин', icon: 'src/assets/images/Bike.PNG' },
    { type: 'E-Bike', price: '5.4₽/мин', icon: './assets/images/E-Bike.PNG' },
    { type: 'E-Scooter', price: '5.4₽/мин', icon: './assets/images/E-Scooter.PNG' }
];

const VehicleSelector = () => {
    return (
        <div className="vehicle-selector">
            {vehicles.map((vehicle, index) => (
                <div key={index} className="vehicle-card">
                    <img src={vehicle.icon} alt={vehicle.type} className="vehicle-icon-img" />
                    <div className="vehicle-info">
                        <span>{vehicle.type}</span>
                        <span className="price">{vehicle.price}</span>
                    </div>
                </div>
            ))}
        </div>
    );
};

export default VehicleSelector;
